import React from 'react'

function Box(props) {
  return (
    <div>
      <div className="box">
          <h2>{props.name}</h2>
          <img className="box-img" src={props.image || (props.image && props.image.img)}/>
          <h4>승패 결과</h4>
        </div>
    </div>
  )
}

export default Box
